{"department_text": "Home & Outdoors", "level": 1, "url": "http://www.newegg.com/Home-Outdoors/Store?name=Home-Outdoors", "text": "Home & Outdoors", "department_url": "http://www.newegg.com/Home-Outdoors/Store?name=Home-Outdoors", "description_title": "Home Improvement and Outdoors TAB Store", "keyword_count": {"home": 3}, "description_wc": 179, "description_text": "At Newegg, not only do we carry the best computer products and parts around, but we\u2019re also your one-stop-shop for everything you need for your home and its maintenance. Deck out your home office with the latest all-in-one devices, and at the same time keep your kitchen up to date with a professional grade mixer that can beat eggs, whip cream and knead dough in minutes. Need to replace your outdated washing machine for one that saves energy? We\u2019ve got that too. Shower head leaking? Get a better replacement from us. Have poor office lighting? We\u2019ve got something better. Need to start working on that endless to-do list of odd jobs around the house? No worries \u2014 we\u2019ve got what you need for that as well, including a wide range of hand and power tools, as well as mowers, weed whackers and other garden tools needed for landscape maintenance. You simply don\u2019t need to shop anywhere but Newegg to get what you need for your home: your most valuable investment.", "keyword_density": {"home": "1.7"}, "department_id": 9}
