{"department_text": "Gift Card & Services", "level": 1, "url": "http://www.newegg.com/Gift-Cards-Services/Store/ID-143?name=Gift-Card-Services", "text": "Gift Card & Services", "department_url": "http://www.newegg.com/Gift-Cards-Services/Store/ID-143?name=Gift-Card-Services", "description_title": "Service Net", "keyword_count": {"service": 3, "service net": 1}, "description_wc": 111, "description_text": "Service Net's Extended Service Plans cover repair or replacement of your product (depending on the plan purchased) if your product should fail. The coverage may include additional benefits during the manufacturer's warranty, or extend coverage beyond the manufacturer's warranty. Our plans offer a simple, quick solution. Replacement : The product will be replaced and shipped directly to you at no charge Accident Protection : Protection in case of accidental mishaps such as drops, spills, and cracked screens. Repair : Should repair be needed we will ship your product to an authorized technician at no charge to you. On-Site : Service will be provided on-site for larger items such as TVs", "keyword_density": {"service": "2.7", "service net": "1.8"}, "department_id": 15}
