{"level": 0, "url": "http://www.newegg.com/Servers-Workstations/Category/ID-271", "text": "Servers & Workstations", "department_url": "http://www.newegg.com/Computer-Hardware/Store", "parent_url": "http://www.newegg.com/Computer-Hardware/Store", "parent_text": "Computer Hardware", "department_text": "Computer Hardware", "department_id": 1}
{"level": 0, "url": "http://www.newegg.com/SSD/Category/ID-119?Tid=11692", "text": "SSD", "department_url": "http://www.newegg.com/Computer-Hardware/Store", "parent_url": "http://www.newegg.com/Computer-Hardware/Store", "description_wc": 76, "description_text": "A solid state drive (SSD), also called solid state disk or solid state hard drive, is a high-performance plug-and-play storage device that contains no moving parts. It is smaller, lighter and faster than the conventional hard disk drive (HDD). Solid state drives run near silent and consume very little power. SSD prices continue to fall and are now much more affordable than they were a couple years ago. Find out more.", "parent_text": "Computer Hardware", "department_text": "Computer Hardware", "department_id": 1}
{"department_text": "Computer Hardware", "level": 0, "url": "http://www.newegg.com/Soundcards-Speakers-Headsets/Category/ID-37", "text": "Soundcards, Speakers & Headsets", "department_url": "http://www.newegg.com/Computer-Hardware/Store", "description_title": "Speakers, Headsets, & Sound Cards Store", "parent_url": "http://www.newegg.com/Computer-Hardware/Store", "keyword_count": {"sound": 3, "speakers headsets": 1}, "description_wc": 173, "description_text": "Whether you\u2019re preparing for an epic road trip, gearing up for a weekend of LAN partying, improving your home theater system so you can beat the summer movie crowds, or just want to get the most out of your smart phone, a good sound system is not something you should just invest in lightly. In many cases, your speakers, headsets or headphones can make or break your system. Taking a long flight to an exotic destination or simply planning to spend the late hours grinding for that achievement? You\u2019ll want a durable headset and comfortable headphones that suck you into the game or movie and keep unwanted background noises out (like that baby crying four rows ahead). Think that your 5.1 surround sound doesn\u2019t quite convey the audio majesty of your favorite trilogy like you had hoped? Perhaps it\u2019s time to upgrade to 7.1. Whatever your audio needs, we\u2019ve got the products and tips that will ensure you have the resources necessary to build a soundscape masterpiece.", "parent_text": "Computer Hardware", "keyword_density": {"sound": "1.7", "speakers headsets": "1.2"}, "department_id": 1}
