{"nr_products": 23, "level": 0, "url": "http://www.newegg.com/Operating-Systems/SubCategory/ID-368", "text": "Operating Systems", "department_url": "http://www.newegg.com/Software/Store", "parent_url": "http://www.newegg.com/Software/Store", "parent_text": "Software", "department_text": "Software", "department_id": 6}
{"department_text": "Computer Hardware", "level": 0, "url": "http://www.newegg.com/Video-Cards-Video-Devices/Category/ID-38", "text": "Video Cards & Video Devices", "department_url": "http://www.newegg.com/Computer-Hardware/Store", "description_title": "Video Cards", "parent_url": "http://www.newegg.com/Computer-Hardware/Store", "keyword_count": {"video": 1}, "description_wc": 119, "description_text": "Whether you\u2019re an Nvidia fanboy or an AMD diehard, the latest generation of GPUs that are available will push the envelope of immersive gaming like never before. If you want to take it even further, invest in a triple-monitor setup and see what your Nvidia GTX 700 series or AMD 7000 series graphics card can really do with 2-way SLI or CrossFireX. Watch out though \u2014 once you go triple you\u2019ll never want to go back to a single monitor setup. And with even more visually complex games getting released every month, why would you want to? Upgrade your video card today and discover what you\u2019ve been missing out on. You won\u2019t regret it.", "parent_text": "Computer Hardware", "keyword_density": {"video": "0.8"}, "department_id": 1}
{"department_text": "Computer Hardware", "level": 0, "url": "http://www.newegg.com/Projectors/Category/ID-343", "text": "Projectors", "department_url": "http://www.newegg.com/Computer-Hardware/Store", "description_title": "LG Home Theater Projector", "parent_url": "http://www.newegg.com/Computer-Hardware/Store", "keyword_count": {"lg": 2, "home theater": 1, "projector": 8, "home": 2}, "description_wc": 260, "description_text": "Bring your home theater entertainment to a new level with the LG PA75U 3D-ready projector. Sleek and lightweight, this DLP projector featuring 1280x800 resolution and 15000:1 contrast ratio presents your contents with clear, vivid, and detailed images up to 100\" in size. You'll appreciate the built-in TV tuner for watching high quality TV without the need for an external HDTV receiver box. Play movies and photos, or view office and PDF files directly from USB drives. Ultra fast start-up and shut-down time eliminate your hassle of waiting around. Its LED lamp can last up to 30,000 hours, much longer than a traditional halogen bulb, allowing minimum maintenance cost and Total Cost of Ownership (TCO). Add the LG PA75U to your living room, and enjoy evolved visuals for movies, games, TV and more. Find out more. When it is time to invest in a new projector, there is a variety of brands, features and options to choose from. Knowing exactly which projector to purchase can be quite confusing. Prices range from a few hundred dollars to a few thousand dollars. The goal is to get the features that you need at the best possible price. Will you be using your projector for business presentations? Will you be using it for gaming? Do you plan to use the projector for home entertainment needs? What you plan on using your projector for will determine the specs, features and options that will be most important to you. Learn more about projector specifications that you need to consider.", "parent_text": "Computer Hardware", "keyword_density": {"lg": "0.8", "home theater": "0.8", "projector": "3.1", "home": "0.8"}, "department_id": 1}
{"nr_products": 106, "level": 0, "url": "http://www.newegg.com/Software-Security/SubCategory/ID-377", "text": "Software - Security", "department_url": "http://www.newegg.com/Software/Store", "parent_url": "http://www.newegg.com/Software/Store", "parent_text": "Software", "department_text": "Software", "department_id": 6}
{"department_text": "Computer Hardware", "level": 0, "url": "http://www.newegg.com/Printers-Scanners-Supplies/Category/ID-33", "text": "Printers / Scanners & Supplies", "department_url": "http://www.newegg.com/Computer-Hardware/Store", "description_title": "Your imagination is your only limit.", "parent_url": "http://www.newegg.com/Computer-Hardware/Store", "keyword_count": {"imagination": 1}, "description_wc": 138, "description_text": "What is 3D printing? 3D printing is a manufacturing technology that allows you to print three dimensional objects. When creating objects with a 3D printer, you\u2019ll be able to create prototypes or full-scale productions. 3D printers take virtual blueprints from CAD software as a guideline for printing. The machine then reads the design and lays down layers of liquid, powder, paper, or sheet material in a series of cross sections until the object is formed. Everything is added in a sequential layering process so you\u2019ll be able to see every step of the creation process. Many companies are now developing affordable 3D printing solutions for domestic and personal use. With a 3D printer, you can literally create anything you can draw. Use your imagination and let the 3D printer do the work! Find out more.", "parent_text": "Computer Hardware", "keyword_density": {"imagination": "0.7"}, "department_id": 1}
{"department_text": "Computer Hardware", "level": 0, "url": "http://www.newegg.com/Power-Protection/Category/ID-314", "text": "Power Protection", "department_url": "http://www.newegg.com/Computer-Hardware/Store", "description_title": "Belkin Family of Power Strips & Power Monitors Overview", "parent_url": "http://www.newegg.com/Computer-Hardware/Store", "keyword_count": {"strips": 2, "power strips": 1, "power": 7, "belkin": 3}, "description_wc": 211, "description_text": "As technology becomes more powerful and more affordable, it will often demand more power. Even with energy-conscious models, the costs can add up on your electricity bill when you\u2019ve got a large collection of the latest gadgets. Thankfully, our power strips can help conserve energy and keep power at consistent levels so your electronics don\u2019t waste energy when they\u2019re not in use. You can also keep track of your carbon footprint with an Energy Cost Monitor that displays the carbon dioxide emissions your electronic equipment gives off, as well as its operating costs and how much wattage it\u2019s using. In addition, when you\u2019ve invested in a high-end gaming PC you\u2019ll want to protect it in case of power outages or failures. Our surge protector strips and surge suppressors will do just that, and we carry a wide variety of options that can do more than just provide additional outlets for all your power cords. Keep your electronics safe and keep your costs down \u2013 power protection is just something you can\u2019t afford to do without. Find out more. BELKIN F7C007q Conserve Smart AV surge Belkin F7C005q Conserve Insight Energy Cost Monitor BELKIN CNS08-T-06 6 ft. 8 Outlets Conserve Surge with Timer", "parent_text": "Computer Hardware", "keyword_density": {"strips": "0.9", "power strips": "0.9", "power": "3.3", "belkin": "1.4"}, "department_id": 1}
