{"department_text": "Computer Hardware", "level": 0, "url": "http://www.newegg.com/Power-Supplies/Category/ID-32", "text": "Power Supplies", "department_url": "http://www.newegg.com/Computer-Hardware/Store", "description_title": "", "parent_url": "http://www.newegg.com/Computer-Hardware/Store", "keyword_count": {}, "description_wc": 229, "description_text": "Each component in the RM Series is optimized for performance and silence. The 80 PLUS Gold certified efficient design of the RM Series means minimal excess heat generation, and thanks to the Zero RPM fan mode the fan doesn't even need to spin under low to medium loads. The custom-designed fan is optimized for quiet operation even at full speed. And when you're pushing it hard, the thermal sensor controls the fan speed to ensure that it gets the cooling it needs without any extra noise. Corsair\u2019s fully modular cable configuration makes installation quick and easy. The flexible black colored cables are also flat so that you can route them behind things like a motherboard tray or drive cage to help with cable management and achieve better airflow. RM Series power ratings are continuous, not peak, for superior protection for your valuable PC. Corsair uses high-quality internal components, and RM Series power supplies are guaranteed to deliver clean, stable, continuous power. RM Series power supplies connect to Corsair Link software for real-time monitoring of fan speed and power delivery directly from your desktop. All products within the RM Series will work with Corsair Link. The cable is included at no additional cost with the 1000W and is available for purchase for the other wattages. Find out more. RM1000 RM850 RM750 RM650 RM550 RM450", "parent_text": "Computer Hardware", "keyword_density": {}, "department_id": 1}
