{"department_text": "Computer Hardware", "level": 0, "url": "http://www.newegg.com/Networking/Category/ID-281", "text": "Networking", "department_url": "http://www.newegg.com/Computer-Hardware/Store", "description_title": "Qualcomm VIVE (11AC) and Streamboost Technology", "parent_url": "http://www.newegg.com/Computer-Hardware/Store", "keyword_count": {"qualcomm": 5, "11ac": 6, "qualcomm vive": 3}, "description_wc": 162, "description_text": "Your wireless network is getting crowded. Moving your media around to all your devices requires Wi-Fi networks that keep up with intense demands for more bandwidth and speed. Introducing Qualcomm\u00ae VIVE\u2122 802.11ac delivering you \u201cWi with a lot more Fi\u201d to unleash Gigabit Wi-Fi for faster and more efficient connectivity to all your devices. With Qualcomm VIVE 802.11ac, you can enjoy faster downloads, smoother video and music streams, and latency-free gaming, on more connected devices. Qualcomm 11ac gives you 3x better speeds over 11n and is more power efficient, which helps you conserve electricity and mobile battery life, too. Qualcomm is leading the 11ac transition with a full ecosystem of 11ac solutions inside devices like smartphones, tablets, TVs, computers, and routers. In short, Qualcomm VIVE 802.11ac offers great performance to bring rich content to life on all your connected devices! Find out more. D-Link DGL-5500 | TP-LINK Archer C7 | NETGEAR R6100 (Coming Soon) | Belkin AC1750 (Coming Soon)", "parent_text": "Computer Hardware", "keyword_density": {"qualcomm": "3.1", "11ac": "3.7", "qualcomm vive": "3.7"}, "department_id": 1}
{"department_text": "Computer Hardware", "level": 0, "url": "http://www.newegg.com/Monitors/Category/ID-19", "text": "Monitors", "department_url": "http://www.newegg.com/Computer-Hardware/Store", "description_title": "What Monitor Specs Require My Attention?", "parent_url": "http://www.newegg.com/Computer-Hardware/Store", "keyword_count": {"monitor": 6}, "description_wc": 98, "description_text": "When it comes to buying a monitor, specifications can vary. The specifications you need to look at will depend on what you are going to be doing with your monitor. Are you going to be performing professional graphic design? Then you\u2019re going to be looking at a different set of specifications for someone who uses their monitor for general home office use. Before purchasing a monitor, it\u2019s crucial to understand the different specifications and how those specifications will affect the way your monitor performs for you. Learn more about monitor specifications that you need to consider.", "parent_text": "Computer Hardware", "keyword_density": {"monitor": "6.1"}, "department_id": 1}
{"department_text": "Computer Hardware", "level": 0, "url": "http://www.newegg.com/Motherboards/Category/ID-20", "text": "Motherboards", "department_url": "http://www.newegg.com/Computer-Hardware/Store", "description_title": "Intel Core i7 Processor Extreme in the LGA2011 Socket", "parent_url": "http://www.newegg.com/Computer-Hardware/Store", "keyword_count": {"core": 2, "processor": 4, "lga2011 socket": 1, "intel": 2, "intel core": 1}, "description_wc": 85, "description_text": "It\u2019s the best processor to enjoy maximized performance for the most demanding tasks, including HD multimedia streaming, 1080p gaming, and more. Unlocking Intel Core processors in the LGA2011 Socket with an Intel X79 Chipset based motherboard enables system tuning for processor cores, memory, and power. Adjust your system settings for more complex multimedia applications and immersive gaming. Whether you are a novice overclocker or a seasoned veteran, these processors will have you singing their praises in no time. Find out more. 4960X 4930K 4820K", "parent_text": "Computer Hardware", "keyword_density": {"core": "2.4", "intel core": "2.4", "processor": "4.7", "intel": "2.4", "lga2011 socket": "2.4"}, "department_id": 1}
