{"department_text": "Computer Hardware", "level": 0, "url": "http://www.newegg.com/Memory/Category/ID-17", "text": "Memory", "department_url": "http://www.newegg.com/Computer-Hardware/Store", "description_title": "Memory with both muscle and finesse", "parent_url": "http://www.newegg.com/Computer-Hardware/Store", "keyword_count": {"memory": 1}, "description_wc": 96, "description_text": "Cooler temperatures for better overclocking headroom - patented dual-channel DHX cooling system pulls heat away from the modules and allows Dominator Platinum to run at cooler temperatures Fanatical screening for phenomenal performance - Dominator Platinum memory modules are assembled using a \u201cbest of the best\u201d IC screening process. Individual ICs are hand-screened to our highest performance threshold, and then the assembled modules undergo more rounds of rigorous screening and stability testing. Sophisticated Design - The integrated light bar provides a subtle downwash lighting effect that gives your system an impressive look but subtle look. Find out more.", "parent_text": "Computer Hardware", "keyword_density": {"memory": "1.0"}, "department_id": 1}
