{"department_text": "Computer Hardware", "level": 0, "url": "http://www.newegg.com/Input-Devices/Category/ID-29", "text": "Input Devices", "department_url": "http://www.newegg.com/Computer-Hardware/Store", "description_title": "Logitech G600 MMO Gaming Mouse", "parent_url": "http://www.newegg.com/Computer-Hardware/Store", "keyword_count": {"logitech g600 mmo gaming mouse": 1, "mmo": 4, "gaming mouse": 2, "logitech": 2, "mouse": 4, "g600": 3}, "description_wc": 190, "description_text": "With 20 buttons, the Logitech G600 MMO Gaming Mouse is the most customizable and easy-to-use mouse specifically designed for mastering your favorite MMOs. Whether you're out to burn down the boss or are in the heat of a PVP battle, this mouse gives you the power to execute every action with lightning-fast accuracy. This unique design is based on massive testing with hardcore MMO gamers to get rid of mis-click worries, but still give you quick, no-look navigation. The G600 has three primary buttons, 12 thumb buttons, a clickable scroll wheel that tilts, plus DPI and profile switching; all pre-configured for optimal MMO use right out of the box\u2014no drivers required. Buttons and lighting are customizable with three onboard memory profiles to access and change all your buttons, tracking and lighting color settings on any computer with no software requirements. As with other Logitech Gaming mouse, the G600 features great performance and durability with high-precision laser tracking up to 8200 dpi, primary buttons rated to 20 million clicks each and an ultra-durable, braided USB cable. Find out more. White Black", "parent_text": "Computer Hardware", "keyword_density": {"logitech g600 mmo gaming mouse": "2.6", "gaming mouse": "2.1", "mmo": "2.1", "logitech": "1.1", "mouse": "2.1", "g600": "1.6"}, "department_id": 1}
