{"department_text": "Computer Hardware", "level": -1, "url": "http://www.newegg.com/Network-Attached-Storage-NAS/Category/ID-241?Tid=18253", "text": "Network Attached Storage (NAS)", "department_url": "http://www.newegg.com/Computer-Hardware/Store", "description_title": "Personal Cloud", "parent_url": "http://www.newegg.com/Hard-Drives/Category/ID-15", "keyword_count": {"personal cloud": 5, "cloud": 10}, "description_wc": 166, "description_text": "When you store something \u201cin the cloud\u201d, you are storing music, movies, documents and data on giant internet servers around the world. That way you can access your files wherever you are, whenever you want, on your laptop or smartphone or even a different computer. This is the basic concept of cloud storage. A personal cloud is essentially your very own cloud storage. Unlike public clouds, a personal cloud allows you to keep all your content in one safe place on your home network so you can share files, stream media, and access your content anywhere. You can create your own personal cloud by either using a Network Attached Storage (NAS) or by subscribing to an online cloud storage service. There are several advantages of using a NAS as your personal cloud. For example, there are no monthly fees or increasing costs as your data needs grow. Also, you know exactly where your data is and who has access to it in your personal cloud.", "parent_text": "Hard Drives", "keyword_density": {"personal cloud": "6.1", "cloud": "6.1"}, "department_id": 1}
