{"level": -1, "url": "http://www.newegg.com/SSD/Category/ID-119?Tid=11689", "text": "SSD", "department_url": "http://www.newegg.com/Computer-Hardware/Store", "parent_url": "http://www.newegg.com/Hard-Drives/Category/ID-15", "description_wc": 76, "description_text": "A solid state drive (SSD), also called solid state disk or solid state hard drive, is a high-performance plug-and-play storage device that contains no moving parts. It is smaller, lighter and faster than the conventional hard disk drive (HDD). Solid state drives run near silent and consume very little power. SSD prices continue to fall and are now much more affordable than they were a couple years ago. Find out more.", "parent_text": "Hard Drives", "department_text": "Computer Hardware", "department_id": 1}
