{"department_text": "Computer Hardware", "level": -1, "url": "http://www.newegg.com/Wired-Networking/Category/ID-40", "text": "Wired Networking", "department_url": "http://www.newegg.com/Computer-Hardware/Store", "description_title": "Homeplug Powerline Network Adapters featuring Qualcomm Atheros", "parent_url": "http://www.newegg.com/Networking/Category/ID-281", "keyword_count": {"powerline": 3, "qualcomm atheros": 1}, "description_wc": 98, "description_text": "In your house today, you have many devices that need a fast internet connection \u2013 from computers and media servers to SmartTVs and gaming consoles. Powerline technology is a great way to share broadband connections with devices in every room. Powered by Qualcomm Atheros AMP technology, Powerline products use your home\u2019s existing electrical wiring to deliver high-speed Internet connections to every outlet. Just plug in one Powerline adapter near your broadband modem and another near your devices, and enjoy fast broadband for smooth online gaming, fast video & audio streaming, and web surfing from anywhere in your home.", "parent_text": "Networking", "keyword_density": {"powerline": "3.1", "qualcomm atheros": "2.0"}, "department_id": 1}
{"department_text": "Computer Hardware", "level": 0, "url": "http://www.newegg.com/Fans-PC-Cooling/Category/ID-11", "text": "Fans & PC Cooling", "department_url": "http://www.newegg.com/Computer-Hardware/Store", "description_title": "COOLER MASTER Seidon 240M RL-S24M-24PK-R1 Water Cooler", "parent_url": "http://www.newegg.com/Computer-Hardware/Store", "keyword_count": {"seidon 240m": 2, "cooler master": 1, "seidon": 3, "water": 2}, "description_wc": 100, "description_text": "The Seidon 240M is Cooler Master\u2019s latest addition to its incredibly compact watercooling kit line that aims to bring watercooling to the masses. It fits in many cases that support 2 x 120mm fan radiators, is compatible with every available Intel and AMD platform, and is as easy to install as traditional heatsink. It comes factory filled, sealed and tested with a two year zero maintenance guarantee. Thanks to two 120mm PWM fans with a wide RPM range, Seidon can operate silently or unleash a powerful cooling storm at your command. Find out more. Seidon 240M Thermal Fusion 400", "parent_text": "Computer Hardware", "keyword_density": {"seidon 240m": "4.0", "cooler master": "2.0", "seidon": "3.0", "water": "2.0"}, "department_id": 1}
{"department_text": "Computer Hardware", "level": -1, "url": "http://www.newegg.com/Wireless-Networking/Category/ID-41", "text": "Wireless Networking", "department_url": "http://www.newegg.com/Computer-Hardware/Store", "description_title": "Qualcomm VIVE (11AC) and Streamboost Technology", "parent_url": "http://www.newegg.com/Networking/Category/ID-281", "keyword_count": {"qualcomm": 5, "11ac": 6, "qualcomm vive": 3}, "description_wc": 162, "description_text": "Your wireless network is getting crowded. Moving your media around to all your devices requires Wi-Fi networks that keep up with intense demands for more bandwidth and speed. Introducing Qualcomm\u00ae VIVE\u2122 802.11ac delivering you \u201cWi with a lot more Fi\u201d to unleash Gigabit Wi-Fi for faster and more efficient connectivity to all your devices. With Qualcomm VIVE 802.11ac, you can enjoy faster downloads, smoother video and music streams, and latency-free gaming, on more connected devices. Qualcomm 11ac gives you 3x better speeds over 11n and is more power efficient, which helps you conserve electricity and mobile battery life, too. Qualcomm is leading the 11ac transition with a full ecosystem of 11ac solutions inside devices like smartphones, tablets, TVs, computers, and routers. In short, Qualcomm VIVE 802.11ac offers great performance to bring rich content to life on all your connected devices! Find out more. D-Link DGL-5500 | TP-LINK Archer C7 | NETGEAR R6100 (Coming Soon) | Belkin AC1750 (Coming Soon)", "parent_text": "Networking", "keyword_density": {"qualcomm": "3.1", "11ac": "3.7", "qualcomm vive": "3.7"}, "department_id": 1}
{"department_text": "Computer Hardware", "level": -1, "url": "http://www.newegg.com/Network-Attached-Storage-NAS/Category/ID-241?Tid=18255", "text": "Network Attached Storage (NAS)", "department_url": "http://www.newegg.com/Computer-Hardware/Store", "description_title": "Personal Cloud", "parent_url": "http://www.newegg.com/Networking/Category/ID-281", "keyword_count": {"personal cloud": 5, "cloud": 10}, "description_wc": 166, "description_text": "When you store something \u201cin the cloud\u201d, you are storing music, movies, documents and data on giant internet servers around the world. That way you can access your files wherever you are, whenever you want, on your laptop or smartphone or even a different computer. This is the basic concept of cloud storage. A personal cloud is essentially your very own cloud storage. Unlike public clouds, a personal cloud allows you to keep all your content in one safe place on your home network so you can share files, stream media, and access your content anywhere. You can create your own personal cloud by either using a Network Attached Storage (NAS) or by subscribing to an online cloud storage service. There are several advantages of using a NAS as your personal cloud. For example, there are no monthly fees or increasing costs as your data needs grow. Also, you know exactly where your data is and who has access to it in your personal cloud.", "parent_text": "Networking", "keyword_density": {"personal cloud": "6.1", "cloud": "6.1"}, "department_id": 1}
