{"department_text": "Computer Hardware", "level": 0, "url": "http://www.newegg.com/Computer-Accessories/Category/ID-1", "text": "Computer Accessories", "department_url": "http://www.newegg.com/Computer-Hardware/Store", "description_title": "PC Addons and Accessories", "parent_url": "http://www.newegg.com/Computer-Hardware/Store", "keyword_count": {"pc": 2}, "description_wc": 57, "description_text": "Today we're looking at a variety of products that are meant to improve your computer in a few different areas: performance upgrades, convenient add-ons, and aesthetic improvements. These are optional PC parts that fit into often-unused areas, such as open 5.25\" optical drive bays and vacant PCI slots on the back of the case.", "parent_text": "Computer Hardware", "keyword_density": {"pc": "3.5"}, "department_id": 1}
{"department_text": "Computer Hardware", "level": 0, "url": "http://www.newegg.com/CPUs-Processors/Category/ID-34", "text": "CPUs / Processors", "department_url": "http://www.newegg.com/Computer-Hardware/Store", "description_title": "Intel Core i7 Processor Extreme in the LGA2011 Socket", "parent_url": "http://www.newegg.com/Computer-Hardware/Store", "keyword_count": {"core": 2, "processor": 4, "lga2011 socket": 1, "intel": 2, "intel core": 1}, "description_wc": 85, "description_text": "It\u2019s the best processor to enjoy maximized performance for the most demanding tasks, including HD multimedia streaming, 1080p gaming, and more. Unlocking Intel Core processors in the LGA2011 Socket with an Intel X79 Chipset based motherboard enables system tuning for processor cores, memory, and power. Adjust your system settings for more complex multimedia applications and immersive gaming. Whether you are a novice overclocker or a seasoned veteran, these processors will have you singing their praises in no time. Find out more. 4960X 4930K 4820K", "parent_text": "Computer Hardware", "keyword_density": {"core": "2.4", "intel core": "2.4", "processor": "4.7", "intel": "2.4", "lga2011 socket": "2.4"}, "department_id": 1}
