{"department_text": "Computer Hardware", "level": 0, "url": "http://www.newegg.com/Store/Promotion.aspx?storeid=33&name=DIY-PC-SuperCombo", "text": "DIY PC SuperCombo", "department_url": "http://www.newegg.com/Computer-Hardware/Store", "description_title": "Save Money By Building Your Own Computer", "parent_url": "http://www.newegg.com/Computer-Hardware/Store", "keyword_count": {"computer": 6, "save money": 1}, "description_wc": 146, "description_text": "Whether you're a computer enthusiast, business professional or just need something for the kids and their homework, buying a branded computer can be a significant investment. Learning to build your own system not only helps you save money, but also ensures your computer system has everything you need and nothing you don't. Newegg can show you how to get started. With our comprehensive tutorial, you'll learn the basics of how a computer works, the essential parts, and how to put it all together. We'll guide you through choosing the peripherals that meet your needs while explaining why you need them. Best of all, Newegg has a wide selection of computer hardware to fit every budget and system build. So whether this is your first scratch-built computer or your fiftieth and you just want a refresher course, let Newegg show the way!", "parent_text": "Computer Hardware", "keyword_density": {"computer": "4.1", "save money": "1.4"}, "department_id": 1}
