{"level": 0, "url": "http://www.newegg.com/Televisions/Category/ID-264", "text": "Televisions", "department_url": "http://www.newegg.com/Electronics/Store", "parent_url": "http://www.newegg.com/Electronics/Store", "description_wc": 142, "description_text": "Getting Started Looking for a new HDTV but don\u2019t know where to start? Whether you want to watch a game in stunning, precise detail, recreate a movie theater experience at home, or experience real 3D entertainment, Newegg has exactly what you\u2019re looking for. With our new HDTV buying guide, it\u2019s easier than ever to shop for the perfect high definition TV. We cover everything from refresh rates to connection types, as well as how to figure out the proper size and viewing angle of a TV so that it perfectly suits the room you\u2019ve chosen to be your home theater. Down to the very last detail, our guide ensures that you\u2019ll have all the information you need to get the best HDTV possible for a home theater that\u2019s sure to be the envy of the neighborhood.", "parent_text": "Electronics", "department_text": "Electronics", "department_id": 4}
