{"department_text": "Electronics", "level": 0, "url": "http://www.newegg.com/Home-Audio/Category/ID-31", "text": "Home Audio", "department_url": "http://www.newegg.com/Electronics/Store", "description_title": "How to Choose a Sound Bar", "parent_url": "http://www.newegg.com/Electronics/Store", "keyword_count": {"sound": 8, "bar": 2}, "description_wc": 200, "description_text": "Soundbars can provide movie theater surround sound in your living room. They are a great way to bring big sound to smaller to mid-sized spaces. They don\u2019t take up a lot of room or require complex wiring so it\u2019s an easy way to get better sound from your TV. A soundbar is also a simple and inexpensive way to significantly improve your entertainment experience in your living room. Your movies and music have never sounded so good! A/V receivers are designed to provide superior sound performance for your home theater as well as simplify your media center. They are the intermediaries for not only your surround sound system but also your TV set, cable/satellite programming, Blu-ray/DVD player, computer and other media devices. They basically act as a central hub that manages and switches between devices. This allows you to simply move from input to input with the receiver versus connecting all of the cables to the TV. In other words, AV receivers allow you to have compatible devices connected to them and, at the push of a button, are able to switch between devices without unplugging and switching cables. I know, pretty amazing.", "parent_text": "Electronics", "keyword_density": {"sound": "4.0", "bar": "1.0"}, "department_id": 4}
